import React, { useEffect, useState } from 'react';
import { getResult } from './api';
import "./Results.css";

function Results({ token }) {
  const [result, setResult] = useState(null);
  const [current, setCurrent] = useState(0);
  useEffect(() => {
    getResult(token).then(r => {
      setResult(r.data);
      if (r.data && r.data.review) {
        localStorage.setItem('examSubmitted', 'true');
      }
    });
  }, [token]);

  if (!result) return <div className="exam-container card">Loading result...</div>;
  const total = result.review ? result.review.length : 0;
  const correct = result.review ? result.review.filter(q => q.correct === q.selected).length : 0;
  const wrong = total - correct;
  const percent = total ? Math.round((correct/total)*100) : 0;
  const q = result.review ? result.review[current] : null;
  return (
    <div className="result-container card" style={{maxWidth:'1200px',width:'98vw',margin:'0 auto'}}>
      <h2>Exam Submitted</h2>
      <div style={{fontSize:'1.2em',margin:'12px 0'}}>
        <strong>Score:</strong> {result.score} / {total}
      </div>
      <div><strong>Correct:</strong> {correct}</div>
      <div><strong>Wrong:</strong> {wrong}</div>
      <div><strong>Percentage:</strong> {percent}%</div>
      <div>Submitted At: {new Date(result.submittedAt).toLocaleString()}</div>
      <h3 style={{marginTop:24}}>Review Your Answers</h3>
      {q && (
        <div className="review-card" style={{margin:'0 auto',maxWidth:'900px'}}>
          <div className="review-question">{current+1}. {q.question}</div>
          <div className="review-status">
            <span style={{color: q.correct === q.selected ? '#43cea2' : '#d32f2f',fontWeight:600}}>
              {q.correct === q.selected ? 'Correct' : 'Wrong'}
            </span>
          </div>
          <ul className="review-options">
            {q.options.map((opt, i) => (
              <li key={i} style={{
                padding:'4px 0',
                color: q.correct === i ? '#43cea2' : (q.selected === i ? '#d32f2f' : '#333'),
                fontWeight: q.correct === i || q.selected === i ? 600 : 400
              }}>
                <span style={{fontWeight:'bold',marginRight:6}}>{String.fromCharCode(65+i)}.</span> {opt}
                {q.correct === i ? ' (Correct)' : ''}
                {q.selected === i && q.correct !== i ? ' (Your answer)' : ''}
              </li>
            ))}
          </ul>
        </div>
      )}
      <div style={{display:'flex',justifyContent:'center',gap:16,margin:'24px 0'}}>
        <button disabled={current===0} onClick={()=>setCurrent(c=>c-1)}>Previous</button>
        <span>Question {current+1} of {total}</span>
        <button disabled={current===total-1} onClick={()=>setCurrent(c=>c+1)}>Next</button>
      </div>
      <button onClick={() => window.location.hash = '#/dashboard'}>Return to Dashboard</button>
    </div>
  );
}

export default Results;
